import{_ as a}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as i,c as e,b as r}from"./app.8c50ae93.js";const h={},d=r('<h1 id="\u7EC4\u4EF6\u901A\u7528\u80FD\u529B" tabindex="-1"><a class="header-anchor" href="#\u7EC4\u4EF6\u901A\u7528\u80FD\u529B" aria-hidden="true">#</a> \u7EC4\u4EF6\u901A\u7528\u80FD\u529B</h1><p>\u9996\u5148\u6211\u4EEC\u5B9A\u4E49\u7EC4\u4EF6\u9700\u8981\u5177\u5907\u7684\u901A\u7528\u80FD\u529B\uFF08\u76EE\u524D\u6309\u7167Markdown\u4F5C\u4E3A\u539F\u578B\uFF09\uFF0C\u968F\u540E\u6211\u4EEC\u4F1A\u6839\u636E\u8FD9\u79CD\u901A\u7528\u80FD\u529B\u5B9E\u73B0Markdown\u7F16\u8F91\u7EC4\u4EF6\uFF08\u57FA\u4E8EMilkdown\u5B9E\u73B0\uFF09\u3002</p><h2 id="\u901A\u7528\u57FA\u7840\u80FD\u529B" tabindex="-1"><a class="header-anchor" href="#\u901A\u7528\u57FA\u7840\u80FD\u529B" aria-hidden="true">#</a> \u901A\u7528\u57FA\u7840\u80FD\u529B</h2><p>\u8FD9\u4E9B\u80FD\u529B\u662F\u6574\u4E2A\u5DE5\u5177\u4E2D\u6700\u57FA\u672C\u7684\u80FD\u529B\uFF0C\u7C7B\u4F3C\u4E8E\u5BF9\u8C61\u7684CRUD\u3002\u6211\u4EEC\u901A\u8FC7\u8FD9\u79CD\u7ED3\u6784\u8BA9\u4E0A\u5C42\u4E1A\u52A1\u5C4F\u853D\u6389\u4E0B\u5C42\u67AF\u71E5\u800C\u53C8\u91CD\u590D\u7684IO\u673A\u5236\u3002\u8FD9\u5757\u80FD\u529B\u90FD\u662F\u7531\u540E\u7AEF\u8D44\u6E90\u670D\u52A1\u5668\u5B9E\u73B0\u7684\uFF0C\u8D44\u6E90\u670D\u52A1\u5668\u5F15\u5165\u7684\u76EE\u7684\u4F60\u53EF\u4EE5\u7406\u89E3\u4E3A\u7ED9\u4E0A\u5C42\u4E1A\u52A1\u63D0\u4F9B\u4E00\u4E2A\u62BD\u8C61\u7684\u8BBF\u95EE\u903B\u8F91\uFF0C\u5E76\u4E0D\u9700\u8981\u5173\u5FC3\u662F\u4F55\u79CD\u5B58\u50A8\u65B9\u5F0F\u3002</p><p><img src="https://img.jaken.top/image/20221011102033.png" alt="20221011102033" loading="lazy"></p><h3 id="\u8D44\u6E90\u5BF9\u8C61" tabindex="-1"><a class="header-anchor" href="#\u8D44\u6E90\u5BF9\u8C61" aria-hidden="true">#</a> \u8D44\u6E90\u5BF9\u8C61</h3><p>\u6BCF\u4E00\u79CD\u7C7B\u578B\u7684\u8D44\u6E90\u90FD\u6709\u4ED6\u7684\u5BF9\u5E94\u7684\u8D44\u6E90\u5BF9\u8C61\u3002\u8FD9\u4E2A\u5BF9\u8C61\u7528\u6765\u6807\u8BC6\u4E00\u4E2A\u8D44\u6E90\u7684\u6240\u6709\u5143\u6570\u636E\uFF0C\u800C\u7B14\u8BB0\u5DE5\u5177\u7684\u6E32\u67D3\u8FC7\u7A0B\u5176\u5B9E\u662F\u8D44\u6E90\u5BF9\u8C61\u7684\u6E32\u67D3\u8FC7\u7A0B\u3002\u8FD9\u91CC\u6682\u65F6\u5B9A\u4E49\u4E00\u4E9B\u5E38\u7528\u7684\u5143\u6570\u636E\uFF1A</p><ul><li>\u8D44\u6E90\u5BF9\u8C61\u552F\u4E00\u6807\u8BC6</li><li>\u8D44\u6E90\u5BF9\u8C61\u7684\u7C7B\u578B\u6807\u8BC6\uFF08\u6839\u636E\u7C7B\u578B\u53EF\u4EE5\u786E\u5B9A\u4ED6\u662F\u90A3\u79CD\u8D44\u6E90\u5E76\u4E14\u5982\u4F55\u6E32\u67D3\u7B49\uFF09</li><li>\u8D44\u6E90\u5BF9\u8C61\u7269\u7406\u7C7B\u578B\u6807\u8BC6\uFF08\u6807\u8BC6\u8FD9\u4E2A\u5BF9\u8C61\u662F\u5B58\u5728\u4F55\u79CD\u7269\u7406\u5B58\u50A8\u4E2D\u7684\uFF09</li><li>\u8D44\u6E90\u5BF9\u8C61\u539F\u59CB\u8D44\u6E90\u4F4D\u7F6E\uFF08\u5305\u62EC\u4E86\u83B7\u53D6\u8FD9\u4E2A\u8D44\u6E90\u7684\u9014\u5F84\u548C\u65B9\u5F0F\uFF09</li><li>\u8D44\u6E90\u5BF9\u8C61\u7684\u7269\u7406\u540D\u79F0\uFF08\u5373\u4ED6\u7684\u6E90\u6587\u4EF6\u7684\u540D\u79F0\uFF0C\u5F53\u6211\u4EEC\u5BFC\u51FA\u5BF9\u8C61\u65F6\u5C31\u662F\u7528\u8BE5\u540D\u79F0\uFF09</li><li>\u8D44\u6E90\u5BF9\u8C61\u7684\u522B\u540D\uFF08\u5728\u7B14\u8BB0\u5DE5\u5177\u4E2D\u5B9A\u4E49\u7684\u5176\u4ED6\u540D\u79F0\uFF0C\u53EF\u4EE5\u6709\u591A\u4E2A\u65B9\u4FBF\u68C0\u7D22\uFF09</li><li>\u8D44\u6E90\u5BF9\u8C61\u7684\u6807\u7B7E\uFF08\u53EF\u4EE5\u6709\u591A\u4E2A\uFF09</li><li>\u8D44\u6E90\u5BF9\u8C61\u7684\u7269\u7406\u5143\u6570\u636E\uFF08\u521B\u5EFA\u4EBA\uFF0C\u521B\u5EFA\u65F6\u95F4\uFF0C\u4FEE\u6539\u65F6\u95F4\uFF0C\u6269\u5C55\u5B57\u6BB5\u7B49\uFF09</li><li>\u8D44\u6E90\u5BF9\u8C61\u5173\u8054\u7684\u5173\u7CFB\u8BB0\u5F55</li></ul><h3 id="\u7247\u6BB5\u5BF9\u8C61" tabindex="-1"><a class="header-anchor" href="#\u7247\u6BB5\u5BF9\u8C61" aria-hidden="true">#</a> \u7247\u6BB5\u5BF9\u8C61</h3><p>\u7247\u6BB5\u5BF9\u8C61\u662F\u8D44\u6E90\u5BF9\u8C61\u7684\u7EC6\u7C92\u5EA6\u884C\u4E3A\uFF0C\u4F8B\u5982\u4E00\u4E2AMarkdown\u8D44\u6E90\u4E2D\u7684\u6BCF\u4E00\u4E2A\u6BB5\u843D\u90FD\u53EF\u4EE5\u662F\u4E00\u4E2A\u7247\u6BB5\u5BF9\u8C61\uFF1B\u4E00\u4E2A\u5BFC\u56FE\u4E2D\u7684\u6BCF\u4E2A\u8282\u70B9\u4E5F\u90FD\u662F\u4E00\u4E2A\u7247\u6BB5\u5BF9\u8C61\u3002\u7247\u6BB5\u5BF9\u8C61\u662F\u8D44\u6E90\u5BF9\u8C61\u7684\u5B50\u96C6\uFF0C\u56E0\u6B64\u4ED6\u652F\u6301\u6240\u6709\u8D44\u6E90\u5BF9\u8C61\u7684\u80FD\u529B\uFF0C\u540C\u65F6\u8FD8\u63D0\u4F9B\u4E86\u4E00\u4E9B\u989D\u5916\u7684\u884C\u4E3A\uFF0C\u4F8B\u5982\u7247\u6BB5\u5728\u8D44\u6E90\u5BF9\u8C61\u4E2D\u5B9A\u4F4D\uFF0C\u67E5\u627E\u7B49\uFF0C\u4EE5\u53CA\u4E00\u4E9B\u72EC\u7ACB\u7684\u884C\u4E3A\u3002<strong>\u6CE8\u610F\uFF1A\u6211\u4EEC\u8BA4\u4E3A\u8D44\u6E90\u5BF9\u8C61\u53EF\u4EE5\u5173\u8054\u548C\u5F15\u7528\uFF0C\u4E5F\u5C31\u4EE3\u8868\u4E86\u7247\u6BB5\u5BF9\u8C61\u4E5F\u652F\u6301\u8FD9\u4E9B\u884C\u4E3A</strong></p><h3 id="\u5173\u7CFB\u5BF9\u8C61" tabindex="-1"><a class="header-anchor" href="#\u5173\u7CFB\u5BF9\u8C61" aria-hidden="true">#</a> \u5173\u7CFB\u5BF9\u8C61</h3><p>\u9700\u8981\u5B9E\u73B0\u5173\u7CFB\u6A21\u5757\u76F8\u5173\u529F\u80FD\uFF0C\u9700\u8981\u6211\u4EEC\u9664\u4E86\u8D44\u6E90\u5BF9\u8C61\u3001\u7247\u6BB5\u5BF9\u8C61\u5916\uFF0C\u8FD8\u9700\u8981\u4E00\u4E2A\u7279\u6B8A\u7684\u5BF9\u8C61\u7EC4\u7EC7\u8D44\u6E90\u548C\u7247\u6BB5\u4E4B\u95F4\u7684\u5173\u7CFB\uFF0C\u56E0\u6B64\u6211\u4EEC\u5B9A\u4E49\u4E86\u4E00\u4E2A\u5173\u7CFB\u5BF9\u8C61\uFF0C\u4ED6\u5305\u62EC\u4E86\u4F8B\u5982\u4E00\u4E2AMarkdown\u7247\u6BB5\u4E2D\u5305\u62EC\u4E86\u54EA\u4E9B\u5F15\u7528\u3002\u901A\u8FC7\u8FD9\u4E2A\u5BF9\u8C61\u6211\u4EEC\u53EF\u4EE5\u5B9E\u73B0\u5757\u7EA7\u7D22\u5F15\u7B49\u529F\u80FD\u3002\u5173\u7CFB\u5BF9\u8C61\u662F\u6709\u4E0A\u5C42\u4E1A\u52A1\u5C42\u521B\u5EFA\u5E76\u7EF4\u62A4\u7684\uFF0C\u56E0\u6B64\u8FD9\u91CC\u4E0D\u505A\u8FC7\u591A\u7684\u9610\u8FF0\u3002</p><h3 id="\u7269\u7406\u5BF9\u8C61io\u63A5\u53E3" tabindex="-1"><a class="header-anchor" href="#\u7269\u7406\u5BF9\u8C61io\u63A5\u53E3" aria-hidden="true">#</a> \u7269\u7406\u5BF9\u8C61IO\u63A5\u53E3</h3><p>\u5F53\u6211\u4EEC\u9700\u8981\u8BFB\u53D6\u6216\u8005\u4FEE\u6539\u5BF9\u8C61\u65F6\uFF0C\u9700\u8981\u5BF9\u8FD9\u4E2A\u5BF9\u8C61\u4F5C\u51FA\u5B9E\u8D28\u6027\u7684\u6539\u52A8\uFF0C\u6B64\u65F6\u5C31\u8BBE\u8BA1\u4E86\u4ED6\u7684IO\u63A5\u53E3\u3002\u5176\u4E2D\u5305\u62EC\u5BF9\u8C61\u5185\u5BB9\u7684\u8BFB\u53D6\u3001\u4FEE\u6539\u3001\u5220\u9664\u3001\u79FB\u52A8\u3001\u6253\u5F00\u7B49\u529F\u80FD\uFF0C\u8FD9\u91CC\u6211\u7B80\u5355\u7F57\u5217\u4E0B\uFF0C\u5176\u4E2D\u6BCF\u4E2A\u70B9\u90FD\u9700\u8981\u8003\u8651\u5982\u4F55\u8BBE\u8BA1\u3002</p><p>\u6B64\u63A5\u53E3\u5C06\u4F1A\u5BF9\u63A5\u7269\u7406\u5C42\u9762\u7684IO\u63A5\u53E3\uFF0C\u5373\u4ECE\u4EC0\u4E48\u9014\u5F84\u67E5\u8BE2\u83B7\u53D6\u6570\u636E\uFF08\u6B64\u5904\u7684\u6570\u636E\u662F\u539F\u59CB\u6570\u636E\u53EF\u80FD\u662F\u5B57\u7B26\u4E32\u4E5F\u53EF\u80FD\u662F\u4E8C\u8FDB\u5236\u6587\u4EF6\uFF09\u3002\u7269\u7406\u5BF9\u8C61IO\u63A5\u53E3\u5B9E\u73B0\u53EF\u80FD\u5305\u62EC\uFF08\u6587\u4EF6\u7CFB\u7EDFIO\u3001\u7F13\u5B58IO\u3001SQL IO\u3001\u7F51\u7EDCIO\u7B49\uFF09\u4E0B\u9762\u7F57\u5217\u51FA\u4E00\u4E9B\u9700\u8981\u5B9E\u73B0\u7684\u57FA\u672C\u529F\u80FD\u3002</p><ul><li>\u8D44\u6E90\u5BF9\u8C61\u5168\u91CF\u8BFB\u53D6\uFF0C\u6EDA\u52A8\u8BFB\u53D6\uFF08\u53EF\u80FD\u5BF9\u4E8E\u4E00\u4E9B\u5361\u7247\u7B14\u8BB0\u7B49\u4E0D\u9700\u8981\u6EDA\u52A8\u8BFB\u53D6\uFF09</li><li>\u8D44\u6E90\u5BF9\u8C61\u5168\u91CF\u66F4\u65B0\u64CD\u4F5C\uFF0C\u5C40\u90E8\u66F4\u65B0\u64CD\u4F5C\uFF08\u5168\u91CF\u66F4\u65B0\u9002\u5408\u5C0F\u6587\u4EF6\uFF0C\u5C40\u90E8\u9002\u5408\u5927\u6587\u4EF6\uFF09</li><li>\u8D44\u6E90\u5BF9\u8C61\u79FB\u52A8\uFF0C\u590D\u5236\u3002\u76F8\u5E94\u7684\u79FB\u52A8\u548C\u590D\u5236\u529F\u80FD\u3002</li></ul><h3 id="\u8D44\u6E90\u5BF9\u8C61io\u63A5\u53E3" tabindex="-1"><a class="header-anchor" href="#\u8D44\u6E90\u5BF9\u8C61io\u63A5\u53E3" aria-hidden="true">#</a> \u8D44\u6E90\u5BF9\u8C61IO\u63A5\u53E3</h3><p>\u6BCF\u79CD\u8D44\u6E90\u5BF9\u8C61\u90FD\u4F1A\u6709\u81EA\u5DF1\u7684IO\u65B9\u5F0F\uFF0C\u8FD9\u79CDIO\u9700\u8981\u5BF9\u63A5\u7269\u7406\u5BF9\u8C61\u7684IO\u63A5\u53E3\u3002\u6240\u6709\u7684\u4E1A\u52A1\u5C42\u90FD\u662F\u901A\u8FC7\u8BBF\u95EE\u8BE5\u63A5\u53E3\u4E0E\u8D44\u6E90\u670D\u52A1\u5668\u4EA4\u4E92\uFF0C\u6700\u7EC8\u83B7\u53D6\u6216\u8005\u4FDD\u5B58\u8D44\u6E90\u7684\uFF0C\u8D44\u6E90\u5BF9\u8C61IO\u5BF9\u4E8E\u6BCF\u79CD\u8D44\u6E90\u90FD\u9700\u8981\u6709\u72EC\u7ACB\u7684\u5B9E\u73B0\uFF0C\u6CE8\u610F\u8D44\u6E90\u5BF9\u8C61IO\u53EF\u80FD\u4F1A\u5BF9\u63A5\u591A\u4E2A\u7269\u7406\u5BF9\u8C61\uFF08\u6700\u5E38\u89C1\u7684\u573A\u666F\u5C31\u662F\u591A\u7EA7\u7F13\u5B58\uFF09\u8FD9\u91CC\u7F57\u5217\u4E00\u4E0B\u8D44\u6E90IO\u5305\u62EC\u7684\u57FA\u7840\u529F\u80FD\u3002</p><ul><li>\u8D44\u6E90\u7684CRUD\uFF0C\u589E\u5220\u6539\u67E5\u3002</li><li>\u8D44\u6E90\u7684\u4F4D\u7F6E\u79FB\u52A8\uFF08\u903B\u8F91\u4F4D\u7F6E\u3001\u7269\u7406\u4F4D\u7F6E\uFF09</li><li>\u8D44\u6E90\u5143\u6570\u636E\u7684CRUD\u7B49\u3002</li><li><strong>\u8D44\u6E90\u7247\u6BB5\u80FD\u529B\uFF0C\u4F8B\u5982Markdown\u53EF\u4EE5\u88AB\u7EC6\u5206\u6210\u4E00\u4E2A\u4E00\u4E2A\u7684\u6BB5\u843D\uFF0C\u5BFC\u56FE\u5219\u53EF\u4EE5\u7EC6\u5206\u6210\u6BCF\u4E00\u4E2A\u8282\u70B9</strong>\u3002\u8FD9\u4E9B\u529F\u80FD\u7684\u5B9A\u4E49\u662F\u5BF9\u8D44\u6E90\u5BF9\u8C61\u7C92\u5EA6\u7684\u4E8C\u6B21\u62C6\u5206\u3002\u6211\u4EEC\u9700\u8981\u5728\u8D44\u6E90\u5BF9\u8C61IO\u4E2D\u5B9E\u73B0\u8FD9\u4E9B\u66F4\u7EC6\u7C92\u5EA6\u7684\u8BBF\u95EE\u3002\u8FD9\u53EF\u4EE5\u4F7F\u5F97\u6211\u4EEC\u5B9E\u73B0\u4E1A\u52A1\u4E2D\u7684\u8D44\u6E90\u6E32\u67D3\u548C\u5173\u7CFB\u80FD\u529B\u3002</li><li>\u9700\u8981\u652F\u6301\u6839\u636E\u5F53\u524D\u4FE1\u606F\u53CD\u5411\u83B7\u53D6\u8D44\u6E90/\u7247\u6BB5\u5BF9\u8C61\u5F15\u7528\u4FE1\u606F\uFF08\u4F8B\u5982\u5728Markdown\u4E2D\u7684\u5149\u6807\u51FA\u6211\u53EF\u4EE5\u83B7\u53D6\u4ED6\u5C5E\u4E8E\u54EA\u4E2A\u8D44\u6E90\u5BF9\u8C61\uFF0C\u4EE5\u53CA\u54EA\u4E2A\u7247\u6BB5\u5BF9\u8C61\uFF09</li></ul><h2 id="\u901A\u7528\u4E1A\u52A1\u80FD\u529B" tabindex="-1"><a class="header-anchor" href="#\u901A\u7528\u4E1A\u52A1\u80FD\u529B" aria-hidden="true">#</a> \u901A\u7528\u4E1A\u52A1\u80FD\u529B</h2><p>\u9664\u4E86\u4E0A\u6587\u4E2D\u7684\u57FA\u7840\u80FD\u529B\u5916\uFF0C\u672C\u8D28\u4E0A\u6211\u4EEC\u9700\u8981\u5B9E\u73B0\u4E00\u4E9B\u57FA\u7840\u7684\u4E1A\u52A1\u529F\u80FD\uFF0C\u4F8B\u5982\u8D44\u6E90\u7684\u6E32\u67D3\u3001\u8D44\u6E90\u7684\u5173\u7CFB\u8BB0\u5F55\u3001\u8D44\u6E90\u7684\u4FEE\u6539\u3001\u8D44\u6E90\u4E8B\u52A1\u652F\u6301\u3001\u8D44\u6E90\u7684\u56DE\u6EAF\uFF08\u64A4\u9500\u529F\u80FD\uFF09\u7B49\uFF0C\u8FD9\u4E9B\u529F\u80FD\u9996\u5148\u4F1A\u57FA\u4E8E\u5E95\u5C42\u7684\u57FA\u7840\u80FD\u529B\uFF0C\u540C\u65F6\u4E5F\u4F1A\u6709\u90E8\u5206\u4EA4\u4E92\u9700\u8981\u6D89\u53CA\u5230\u540E\u7AEF\u4E1A\u52A1\u5904\u7406\u80FD\u529B\u7B49\u3002</p><h3 id="\u8D44\u6E90\u6E32\u67D3" tabindex="-1"><a class="header-anchor" href="#\u8D44\u6E90\u6E32\u67D3" aria-hidden="true">#</a> \u8D44\u6E90\u6E32\u67D3</h3><p>\u5728\u524D\u9762\u7684\u7406\u5FF5\u4E2D\u6211\u5E0C\u671B\u53EF\u4EE5\u5B9E\u73B0\u4E00\u4E2A\u5177\u6709\u6DF1\u5EA6\u878D\u5408\u7684\u591A\u79CD\u5F62\u5F0F\u8D44\u6E90\u7684\u5C55\u793A\uFF0C\u8D44\u6E90\u6E32\u67D3\u9700\u8981\u5B9E\u73B0\u9664\u4E86\u672C\u8EAB\u7684\u6E32\u67D3\u5916\uFF0C\u8FD8\u9700\u8981\u5B9E\u73B0\u5173\u7CFB\u6A21\u5757\u7684\u6E32\u67D3\u3002\u4F60\u53EF\u4EE5\u7406\u89E3\u4E3A\u6211\u5E0C\u671B\u5728Markdown\u4E2D\u7684\u67D0\u4E00\u5757\u5D4C\u5165\u4E00\u4E2A\u5BFC\u56FE\u3002<strong>\u6211\u79F0\u4ED6\u4E3A\u5D4C\u5957\u6E32\u67D3\uFF0C\u5373\u67D0\u4E00\u4E2A\u8D44\u6E90\u5BF9\u8C61A\u4E2D\u7684\u67D0\u4E2A\u8D44\u6E90\u7247\u6BB5\u53EF\u4EE5\u662F\u53E6\u4E00\u4E2A\u8D44\u6E90/\u7247\u6BB5\u5BF9\u8C61</strong>\u3002\u8FD9\u662F\u8FD9\u4E2A\u5DE5\u5177\u4E2D\u7684\u6838\u5FC3\u529F\u80FD\u70B9\uFF0C\u56E0\u6B64\u5728\u540E\u671F\u6280\u672F\u9009\u578B\u662F\u6211\u4EEC\u9700\u8981\u627E\u5230\u4E00\u4E2A\u53EF\u4EE5\u652F\u6301\u6DF1\u5EA6\u5B9A\u5236\u5316\u7684\u6846\u67B6\u3002</p><p>\u9664\u4E86\u5D4C\u5957\u6E32\u67D3\u5916\uFF0C\u6211\u4EEC\u8FD8\u9700\u8981\u652F\u6301\u5173\u8054\u6E32\u67D3\u3002\u5728\u5173\u7CFB\u6A21\u5757\u4E2D\u6211\u9610\u8FF0\u4E86\u5173\u8054\u548C\u5F15\u7528\u7684\u533A\u522B\uFF0C\u524D\u8005\u7684\u5D4C\u5957\u6E32\u67D3\uFF0C\u5176\u5B9E\u662F\u5B9E\u73B0\u4E86\u5173\u7CFB\u6A21\u5757\u4E2D\u7684\u5F15\u7528\u5173\u7CFB\u3002\u800C\u540E\u8005\u7684\u5173\u8054\u6E32\u67D3\u5219\u662F\u5B9E\u73B0\u4E86\u5173\u8054\u5173\u7CFB\uFF0C<strong>\u4F60\u53EF\u4EE5\u7406\u89E3\u6210\u6BCF\u4E00\u4E2A\u8D44\u6E90/\u7247\u6BB5\u5BF9\u8C61\u90FD\u53EF\u4EE5\u5173\u8054\u4E00\u4E2A\u6216\u591A\u4E2A\u8D44\u6E90/\u7247\u6BB5\u5BF9\u8C61</strong>\u3002</p><p>\u9664\u4E86\u57FA\u7840\u6E32\u67D3\u5916\uFF0C\u6211\u4EEC\u8FD8\u9700\u8981\u8003\u8651\u81EA\u52A8\u5237\u65B0\u80FD\u529B\u3002\u4F8B\u5982\u67D0\u4E00\u4E2A\u5BFC\u56FE\u8282\u70B9\u5F15\u7528\u4E86\u4E00\u4E2AMarkdown\uFF0C\u800C\u8FD9\u4E2AMarkdown\u6253\u5F00\u5E76\u4E14\u53D1\u751F\u4E86\u4FEE\u6539\u3002\u6B64\u65F6\u5C31\u9700\u8981\u8FDB\u884C\u81EA\u52A8\u5237\u65B0\u4E86\u3002</p><h3 id="\u5173\u7CFB\u8BB0\u5F55" tabindex="-1"><a class="header-anchor" href="#\u5173\u7CFB\u8BB0\u5F55" aria-hidden="true">#</a> \u5173\u7CFB\u8BB0\u5F55</h3><p>\u6BCF\u4E00\u4E2A\u8D44\u6E90/\u7247\u6BB5\u5BF9\u8C61\u90FD\u4F1A\u6709\u81EA\u5DF1\u7684\u5173\u7CFB\u8BB0\u5F55\uFF0C\u6211\u4EEC\u9700\u8981\u4E00\u4E2A\u72EC\u7ACB\u7684\u6570\u636E\u7ED3\u6784\u6765\u7EF4\u62A4\u8FD9\u79CD\u8BB0\u5F55\uFF0C\u56E0\u6B64\u5173\u7CFB\u5BF9\u8C61\u51FA\u73B0\u4E86\u3002\u5728\u8FD9\u91CC\u9700\u8981\u5B9A\u4E49\u4E00\u4E9B\u7EF4\u62A4\u65B9\u6CD5\uFF0C\u4F8B\u5982\u6839\u636E\u8D44\u6E90\u5BF9\u8C61ID\u67E5\u8BE2\u5173\u8054\u5173\u7CFB\uFF0C\u7EF4\u62A4\u67D0\u4E2A\u8D44\u6E90\u5BF9\u8C61\u4E2D\u7684\u5173\u7CFB\u7B49\u529F\u80FD\u3002</p><h3 id="\u8D44\u6E90\u4FEE\u6539" tabindex="-1"><a class="header-anchor" href="#\u8D44\u6E90\u4FEE\u6539" aria-hidden="true">#</a> \u8D44\u6E90\u4FEE\u6539</h3><p>\u8D44\u6E90\u4FEE\u6539\uFF0C\u6211\u4EEC\u5F3A\u5236\u4ED6\u53EA\u53EF\u4EE5\u4FEE\u6539\u5F53\u524D\u8D44\u6E90\u7684\u76F8\u5173\u5185\u5BB9\u3002\u5BF9\u4E8E\u8FD9\u4E2A\u8D44\u6E90\u5BF9\u8C61\u5F15\u7528\u7684\u6240\u6709\u5176\u4ED6\u8D44\u6E90\u5BF9\u8C61\u90FD\u662F\u53EA\u8BFB\u7684\uFF0C\u5F53\u7136\u5728\u9700\u8981\u65F6\u63D0\u4F9B\u4E00\u4E2A\u6309\u94AE\u5141\u8BB8\u7528\u6237\u6253\u5F00\u8FD9\u4E2A\u8D44\u6E90\u7F16\u8F91\u3002</p><blockquote><p>\u8FD9\u4E00\u529F\u80FD\u662F\u65E9\u671F\u7684\u5B9E\u73B0\u65B9\u6848,\u6211\u4EEC\u5E0C\u671B\u5728\u4ECA\u540E\u53EF\u4EE5\u76F4\u63A5\u5B9E\u73B0\u5728\u4E00\u4E2A\u8D44\u6E90\u5BF9\u8C61\u4E2D\u7F16\u8F91\u53E6\u4E00\u4E2A\u5F15\u7528\u7684\u8D44\u6E90\u5BF9\u8C61\u3002\u4F46\u8FD9\u4E5F\u5C31\u610F\u5473\u7740\u9700\u8981\u4E24\u4E2A\u7126\u70B9\u540C\u65F6\u5BF9\u4E00\u4E2A\u6587\u4EF6\u8FDB\u884C\u4FEE\u6539\uFF0C\u8FD9\u5C31\u9700\u8981\u5F15\u5165\u591A\u4EBA\u534F\u540C\u7684\u4E00\u81F4\u6027\u7B97\u6CD5\u4E86\u3002\u540E\u671F\u8003\u8651\u5546\u4E1A\u5316\u65F6\u53EF\u4EE5\u5B9E\u73B0\u3002</p></blockquote><h3 id="\u8D44\u6E90\u56DE\u6EAF" tabindex="-1"><a class="header-anchor" href="#\u8D44\u6E90\u56DE\u6EAF" aria-hidden="true">#</a> \u8D44\u6E90\u56DE\u6EAF</h3><p>\u5176\u5B9E\u8FD9\u4E2A\u529F\u80FD\u5C31\u7C7B\u4F3C\u64A4\u9500\u548C\u91CD\u505A\uFF0C\u7EC4\u4EF6\u4E2D\u7684\u6BCF\u4E00\u6B65\u64CD\u4F5C\u90FD\u9700\u8981\u6309\u7167\u7279\u5B9A\u7684\u683C\u5F0F\u8BB0\u5F55\u4E0B\u6765\u3002\u5E76\u4E14\u53EF\u4EE5\u751F\u6210\u5BF9\u5E94\u7684\u9006\u5411\u64CD\u4F5C\uFF08\u8FD9\u5757\u53EF\u4EE5\u8003\u8651\u7528\u72B6\u6001\u7BA1\u7406\u7684\u601D\u60F3\uFF0C\u9006\u64CD\u4F5C\u592A\u590D\u6742\u4E86\u4E86\uFF09\u4E5F\u5C31\u662F\u8BB0\u5F55\u6BCF\u4E2A\u6587\u6863\u6700\u8FD1100\u4E2A\u6216\u80051000\u4E2A\u72B6\u6001\uFF0C\u7136\u540E\u56DE\u6EAF\u4ED6\uFF0C\u4F46\u662F\u6211\u5E76\u4E0D\u5927\u4E86\u89E3\u5BF9\u4E8E\u5927\u6587\u4EF6\u6539\u5982\u4F55\u5B9E\u73B0\u8FD9\u4E2A\u529F\u80FD\u3002</p><p>\u5B9E\u9645\u4E0A\u6211\u4EEC\u5B9E\u73B0\u8D44\u6E90\u56DE\u6EAF\u53EF\u4EE5\u7406\u89E3\u4E3A\uFF0C\u6240\u6709\u6253\u5F00\u7684\u8D44\u6E90\u90FD\u6709\u4E00\u4E2A\u64A4\u9500\u6808\uFF08\u7C7B\u4F3Cpinia\u8FD9\u79CD\u72B6\u6001\u7BA1\u7406\u673A\uFF09\uFF0C\u6211\u4EEC\u652F\u6301\u4ED6\u6062\u590D\u5230\u4EFB\u4F55\u4E00\u4E2A\u72B6\u6001\u4E2D\u3002\u8FD9\u4E2A\u6808\u7ED3\u6784\u9664\u4E86\u53EF\u4EE5\u5F39\u51FA\u5916\uFF0C\u540C\u65F6\u4E5F\u9700\u8981\u652F\u6301\u904D\u5386\u7B49\uFF08\u7528\u6237\u53EF\u4EE5\u770B\u5230\u4EE5\u524D\u4FEE\u6539\u7684\u6BCF\u4E2A\u72B6\u6001\uFF09</p><p><strong>\u4EE5\u4E0B\u5185\u5BB9\u53EA\u662F\u9610\u8FF0\u5D4C\u5957\u7F16\u8F91\u5B58\u5728\u7684\u56DE\u6EAF\u96BE\u70B9\uFF0C\u5B9E\u9645\u6682\u65F6\u4E0D\u4F1A\u5B9E\u73B0\uFF01</strong></p><p>\u6BCF\u4E2A\u8D44\u6E90\u7EC4\u4EF6\u53D1\u518D\u751F\u4FEE\u6539\u540E\uFF0C\u90FD\u4F1A\u8C03\u7528\u8D44\u6E90\u56DE\u6EAF\u7684\u8BB0\u5F55\u5668\uFF0C\u751F\u6210\u4E00\u4E2A\u8D44\u6E90\u56DE\u6EAF\u5BF9\u8C61\u3002\u5E76\u4E14\u628A\u8BE5\u5BF9\u8C61\u653E\u5728\u4E00\u4E2A\u8BE5\u8D44\u6E90\u7EC4\u4EF6\u7684\u56DE\u6EAF\u6808\u4E2D\u3002\u540C\u65F6\u6BCF\u4E00\u4E2A\u64CD\u4F5C\u7A97\u53E3\u90FD\u4F1A\u521B\u5EFA\u4E00\u4E2A\u4E0E\u4E4B\u5173\u8054\u7684\u56DE\u6EAF\u6808\uFF08\u8FD9\u4E2A\u6808\u4F1A\u8BB0\u5F55\u5728\u5BF9\u5E94\u7A97\u53E3\u4E2D\u751F\u6210\u7684\u8D44\u6E90\u56DE\u6EAF\u5BF9\u8C61\uFF09\u3002\u6B64\u65F6\u5047\u5B9A\u6211\u4EEC\u5B58\u5728A\u3001B\u3001C\u4E09\u4E2A\u8D44\u6E90\uFF0C\u5176\u4E2DC\u8D44\u6E90\u72EC\u7ACB\u6253\u5F00\uFF0CB\u8D44\u6E90\u88ABA\u5F15\u7528\u6253\u5F00\uFF0CA\u8D44\u6E90\u4E2D\u5F15\u7528\u4E86BC\uFF0C\u5176\u4E2D1\u7A97\u53E3\u6253\u5F00\u4E86A\uFF0C2\u7A97\u53E3\u6253\u5F00\u4E86B\uFF0C3\u7A97\u53E3\u6253\u5F00\u4E86C\uFF0C\u5982\u4E0B\u56FE\u6240\u793A\uFF0C\u6B64\u65F6\u8003\u8651\u4E00\u4E0B\u573A\u666F\uFF1A</p><p><img src="https://img.jaken.top/image/20221011150325.png" alt="20221011150325" loading="lazy"></p><ol><li>\u7528\u6237\u5728A\u4E2D\u64CD\u4F5C\u4E86Aa,Ab;\u5728B\u4E2D\u64CD\u4F5C\u4E86Ba,Bb;\u5728C\u4E2D\u64CD\u4F5C\u4E86Ca\u3002\u6B64\u65F61\u7A97\u53E3\u7684\u56DE\u6EAF\u6808\u5305\u62EC\u4E86Aa,Ab,Ba,Ca,Bb;\u7A97\u53E32\u7684\u56DE\u6EAF\u6808\u5305\u62EC\u4E86Ba,Ca,Bb;\u7A97\u53E33\u7684\u56DE\u6EAF\u6808\u5305\u62EC\u4E86Ca\u3002\u6B64\u65F6\u5982\u679C\u57281\u4E2D\u64A4\u95002\u6B65\uFF0C\u6B64\u65F6Ca,Bb\u3002</li></ol><p><strong>\u6B64\u5904\u5185\u5BB9\u4F5C\u5E9F</strong></p><h2 id="\u4E0B\u4E00\u6B65" tabindex="-1"><a class="header-anchor" href="#\u4E0B\u4E00\u6B65" aria-hidden="true">#</a> \u4E0B\u4E00\u6B65</h2><p>\u8FD9\u91CC\u6211\u7B80\u5355\u7684\u63CF\u8FF0\u4E86\u4E00\u4E0B\u7EC4\u4EF6\u7684\u901A\u7528\u80FD\u529B\uFF0C\u63A5\u4E0B\u6765\u6211\u4F1A\u6839\u636E\u63CF\u8FF0\u628A\u4ED6\u62BD\u8C61\u6210\u5BF9\u5E94\u7684\u7C7B\u56FE\uFF0C\u5E76\u4E14\u63CF\u8FF0\u5404\u4E2A\u7EC4\u4EF6\u9700\u8981\u5B9E\u73B0\u7684\u63A5\u53E3\u4EE5\u53CA\u5B9E\u73B0\u65B9\u5F0F\u3002</p>',40),n=[d];function l(t,o){return i(),e("div",null,n)}const c=a(h,[["render",l],["__file","\u7EC4\u4EF6\u901A\u7528\u80FD\u529B.html.vue"]]);export{c as default};
